function List({id, title, price, description, category, image}){
    const formatPrice=new Intl.NumberFormat('en-US', {
        style: 'currency',
        currency: 'USD',
    }).format(price);
    
    return(
        <div>
            <p>{category}</p>

            <img src={image} height={200} width={200} objectFit="contain"/>

            <h4>{title}</h4>
            <p>{description}</p>
            <p>{formatPrice}</p>
        </div>
    )
}

export default List;
